import React, { Component } from 'react';
import { MDBCard, MDBCardImage, MDBCardBody, MDBCardTitle, MDBCardSubTitle, MDBRow, MDBCol } from 'mdb-react-ui-kit';
import Principal from './Principal';
import '../css/Perfilcss.css'
import axios from 'axios';
import url from '../Conexions/conexion.js'
import {
    DatePicker,
    MuiPickersUtilsProvider,
} from '@material-ui/pickers';
import DateFnsUtils from '@date-io/date-fns';
import { format } from 'date-fns';
import swal from 'sweetalert';

const baseURL1 = url.url + "/StudentNotebook/Id";
const baseURL2 = url.url + "/StudentNotebook";
const baseURL3 = url.url + "/Schedule/Student";

class AgendaEstudiante extends Component {
    state = {
        schedules: [],
        time: new Date(),
        lugar: '',
        fechainicial: '',
        pruebaid: '',
        fechaFinal: '',
        url: '',
        photos: '',
        state: true

    }

    componentDidMount = () => {
        this.GetAgendaAun();
    }

    GetAgendaAun = () => {
        const config = {
            headers: { 'Authorization': 'Bearer ' + localStorage.getItem("token") }
        }
        // console.log(config)
        axios.get(baseURL2, config)
            .then(response => {
                this.setState({
                    schedules: response.data.schedules,
                    photo: response.data.schedules.photo,
                    status: true
                })
                //console.log(response);
            })
            .catch((error) => {
                console.log(error);
            });
    }

    GetAgenda = () => {
        const config = {
            headers: { 'dateFilter': this.state.fechainicial, 'Authorization': 'Bearer ' + localStorage.getItem("token") }
        }
        axios.get(baseURL1, config)
            .then(response => {
                this.setState({
                    schedules: response.data.schedules,
                    photo: response.data.schedules.photo,
                    status: true
                })
                //console.log(response);
            })
            .catch((error) => {
                console.log(error);
            });
    }

    handleChangeinicial = time => {
        this.setState({
            time: time
        })
    };

    deleteRow(id, e) {
        e.preventDefault()
        console.log(id)
        // do something with id
        const config = {
            headers: { 'scheduleId': id, 'Authorization': 'Bearer ' + localStorage.getItem("token") }
        }

        console.log(config)


        axios.delete(baseURL3, config).then(res => {
            console.log(res.status);
            if (res.status === 200) {

                swal({
                    title: "CITA",
                    text: "Su CITA se elimino con exitoso",
                    icon: "success",
                    buttons: "Aceptar"
                }).then(function () {
                    window.location = "/AgendaConcejero";
                })
            } if (res.status === 400) {
                swal({
                    title: "CITA",
                    text: "Verifique la tabla",
                    icon: "warning",
                    buttons: "Aceptar"
                })
            } else {

            }
        }).catch((error) => {
            console.log(error);
        });
    }

    render() {
        const nueva = format(this.state.time, "yyyy-MM-dd")
        this.fechainicial = nueva
        return (
            <div >
                <div className='sb-nav-fixed'>
                    <div className='row g-0'>
                        <div id="layoutSidenav_content">
                            <Principal />
                            <div className='margen-top h-100'>
                                <div className='d-flex justify-content-center align-items-center h-100'>
                                    <div className=''>
                                        <div className='card' style={{ borderRadius: '2rem' }}>
                                            <div className=''>
                                                <div className='align-items-center'>
                                                    <div className=' p-4 text-black'>
                                                        <section className="centrarelementos">
                                                            <h2 className="text-center mb-4">ATENEO TUTORIAS</h2>
                                                        </section>
                                                        <form className="form">
                                                            <div className="mb-4 centrarelementos">
                                                                <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                                                    <DatePicker format="yyyy-MM-dd" value={this.state.time} label="Fecha Inicial" name='time' id='time' onChange={this.handleChangeinicial} />
                                                                </MuiPickersUtilsProvider>

                                                                <button type="button" className="btn btn-outline-danger form-label boton-color" onClick={this.GetAgenda}>BUSCAR</button>
                                                            </div>
                                                        </form>
                                                        <form className="form">
                                                            {this.state.schedules.map(elem => (


                                                                <MDBRow className='row-cols-1 row-cols-md-3 g-4' >
                                                                    <br></br>
                                                                    <MDBCol>
                                                                        <MDBCard className='h-100' style={{ width: '20rem' }} id={elem.id}>

                                                                            <MDBCardImage
                                                                                className='img-perfil centrarelementos'
                                                                                src={elem.photo}
                                                                                alt='SIN ASIGNAR'
                                                                                position='top'
                                                                            />

                                                                            <MDBCardBody>
                                                                                <MDBCardTitle>{elem.queryType}</MDBCardTitle>
                                                                                <MDBCardSubTitle>Nombre Docente = {elem.teacherFullName}</MDBCardSubTitle>
                                                                                <MDBCardSubTitle>Materias = {elem.subjects.map(e=>(e.name + ","))}</MDBCardSubTitle>
                                                                                <MDBCardSubTitle>Fecha = {elem.date}</MDBCardSubTitle>
                                                                                <MDBCardSubTitle>Tiempo = {elem.time}</MDBCardSubTitle>
                                                                                <MDBCardSubTitle>Lugar = {elem.place}</MDBCardSubTitle>
                                                                                <MDBCardSubTitle>url = <a href={elem.url}> link</a> </MDBCardSubTitle>
                                                                                <div class="form-group row">
                                                                                    <button type="button" className="centrarelementos btn btn-outline-danger form-label boton-color col-sm-5" id={elem.id} onClick={(e) => this.deleteRow(elem.id, e)}>ELIMINAR</button>                                                                                    
                                                                                </div>
                                                                            </MDBCardBody>
                                                                        </MDBCard>
                                                                    </MDBCol>
                                                                    <br></br>

                                                                </MDBRow>

                                                            ))}


                                                        </form>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>

                        </div>

                    </div>
                </div>

            </div>
        );
    }
}

export default AgendaEstudiante;
